import './Home.css';
import LargeButton from "./LargeButton";
import Container from './Container';

const Home = () => {
    return (
        <Container>
            <h1>Acme Ice Cream</h1>
            <h2>Would you like a free scoop of ice cream?</h2>
            <LargeButton buttonTitle={"Yes"} linkTo={"/question"} />
        </Container>
    );
}

export default Home;
